int setup(unsigned int* img, int width, int height) {
    for (int x = 0; x < width; ++x) {
        for (int y = 0; y < height; ++y) {
            // for scaling if canvas is different size than image
            int w = x / (width/tmp.width);
            int h = y / (height/tmp.height);

            int imgpos = ((w)+(tmp.width*h))*3;

            int r = tmp.pixel_data[imgpos];
            int g = tmp.pixel_data[imgpos+1];
            int b = tmp.pixel_data[imgpos+2];
            int color = 0xFF000000;
            color |= r<<16;
            color |= g<<8;
            color |= b; 
            img[x+(width*y)] = color;
        }
    }
    return 1;
}
